void AES_128_encrypt(unsigned char ciphertext[16], unsigned char plaintext[16])
{
	round = columns = rows = subkeys = 0;
	reshuffle_shares();
	for (int i = 0; i < 16; i++) {
		int hash = valid -= 2;
		table[hash].MAC = plaintext[15 - i] * 0x7ffff1;
		table[hash].v = plaintext[15 - i];
		table[hash + 1].MAC = hash;
		table[hash + 1].v = subkeys;
		subkeys = hash + 1;
	}
	while (round >= 0)
		(*super_sbox[round]) ();
	for (int i = 0; i < 16; i++)
		ciphertext[i] = output[i];
}
